CREATE DEFINER=`sql_whatsjuju_pa`@`localhost` EVENT `delete_old_chats` ON SCHEDULE EVERY 1 DAY STARTS '2025-07-05 03:06:24' ON COMPLETION NOT PRESERVE ENABLE DO DELETE FROM chats WHERE created_at < NOW() - INTERVAL 30 DAY$$

CREATE DEFINER=`sql_whatsjuju_pa`@`localhost` EVENT `cleanup_old_messages` ON SCHEDULE EVERY 1 DAY STARTS '2025-07-18 20:22:29' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
    -- Deletar mensagens mais antigas que o período configurado
    DELETE m FROM messages m
    INNER JOIN system_settings s ON s.setting_key = 'message_retention_days'
    WHERE m.created_at < DATE_SUB(NOW(), INTERVAL CAST(s.setting_value AS UNSIGNED) DAY)
    AND m.is_deleted = 0;
    
    -- Log da limpeza
    VALUES ('cleanup_messages', CONCAT('Limpeza automática executada - ', ROW_COUNT(), ' mensagens removidas'), NOW());
END$$

